import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let newDateTime = new Date();
let hours = newDateTime.getHours();

ReactDOM.render(
  <>
    <div className='mainWrapper'>
      <div className='innerWrapper'>
        <div className='bar'>
          <p>Hello Sir , 
            {hours > 1 && hours < 12}
            <span>
              Good Morning
            </span>


          </p>
        </div>
      </div>
    </div>
  </>
,document.getElementById('root'));
